{
  "openapi": "3.0.1",
  "info": {
    "title": "Feed Management",
    "description": "Feeds are constructed to handle bulk functions. A feed consists of an HTTP request with an attached file. Once you upload the Feeds, you can use the Feed ID to track the status of the feeds and the status of the item within those Feeds."
  },
  "servers": [
    {
      "url": "https://marketplace.walmartapis.com",
      "description": "Production URL"
    },
    {
      "url": "https://sandbox.walmartapis.com",
      "description": "Sandbox URL"
    }
  ],
  "security": [
    {
      "basicScheme": []
    }
  ],
  "paths": {
    "/v3/feeds": {
      "get": {
        "tags": [
          "Feeds"
        ],
        "summary": " All feed statuses",
        "description": "Returns the feed statuses for all the specified Feed IDs.",
        "operationId": "getAllFeedStatuses",
        "parameters": [
          {
            "name": "feedId",
            "in": "query",
            "description": "A unique ID returned from the Bulk Upload API, used for tracking the Feed File. Special characters must be escaped. (e.g., feedId: '...3456@789...' must be entered in the URL as '...3456%40789).",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "offset",
            "in": "query",
            "description": "The object response to start with, where 0 is the first entity that can be requested. It can only be used when includeDetails is set to true.",
            "required": false,
            "schema": {
              "type": "string",
              "default": "0"
            }
          },
          {
            "name": "limit",
            "in": "query",
            "description": "The number of entities to be returned. It cannot be more than 50 entities. Use it only when the includeDetails is set to true.",
            "required": false,
            "schema": {
              "type": "string",
              "default": "50"
            }
          },
          {
            "in": "header",
            "name": "Authorization",
            "description": "Basic authorization header. Base 64 encodes the Client ID and Client Secret retrieved in step two of the integration steps.",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Basic YzcyOTFjNmItNzI5MC00...."
          },
          {
            "in": "header",
            "name": "WM_SEC.ACCESS_TOKEN",
            "description": "The access token retrieved in the Token API call",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "eyJraWQiOiIzZjVhYTFmNS1hYWE5LTQzM....."
          },
          {
            "in": "header",
            "name": "WM_CONSUMER.CHANNEL.TYPE",
            "description": "A unique ID to track the consumer request by channel. Use the Consumer Channel Type received during onboarding",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "header",
            "name": "WM_QOS.CORRELATION_ID",
            "description": "A unique ID which identifies each API call and used to track and debug issues; use a random generated GUID for this ID",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "b3261d2d-028a-4ef7-8602-633c23200af6"
          },
          {
            "in": "header",
            "name": "WM_SVC.NAME",
            "description": "Walmart Service Name",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Walmart Service Name"
          }
        ],
        "responses": {
          "200": {
            "description": "Successful Operation",
            "content": {
              "application/xml": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "errors": {
                      "type": "array",
                      "xml": {
                        "name": "error"
                      },
                      "items": {
                        "required": [
                          "code"
                        ],
                        "type": "object",
                        "properties": {
                          "code": {
                            "type": "string"
                          },
                          "field": {
                            "type": "string"
                          },
                          "description": {
                            "type": "string"
                          },
                          "info": {
                            "type": "string"
                          },
                          "severity": {
                            "type": "string",
                            "enum": [
                              "INFO",
                              "WARN",
                              "ERROR"
                            ]
                          },
                          "category": {
                            "type": "string",
                            "enum": [
                              "APPLICATION",
                              "SYSTEM",
                              "REQUEST",
                              "DATA"
                            ]
                          },
                          "causes": {
                            "type": "array",
                            "xml": {
                              "wrapped": true
                            },
                            "items": {
                              "type": "object",
                              "properties": {
                                "code": {
                                  "type": "string"
                                },
                                "field": {
                                  "type": "string"
                                },
                                "type": {
                                  "type": "string"
                                },
                                "description": {
                                  "type": "string"
                                }
                              },
                              "xml": {
                                "name": "Cause"
                              }
                            }
                          },
                          "errorIdentifiers": {
                            "type": "object",
                            "additionalProperties": {
                              "type": "object"
                            }
                          },
                          "component": {
                            "type": "string"
                          },
                          "type": {
                            "type": "string"
                          },
                          "serviceName": {
                            "type": "string"
                          },
                          "gatewayErrorCategory": {
                            "type": "string",
                            "enum": [
                              "INTERNAL_DATA_ERROR",
                              "EXTERNAL_DATA_ERROR",
                              "SYSTEM_ERROR"
                            ]
                          }
                        },
                        "xml": {
                          "name": "GatewayError"
                        }
                      }
                    },
                    "totalResults": {
                      "type": "integer",
                      "description": "Total number of feeds returned",
                      "format": "int64"
                    },
                    "offset": {
                      "type": "integer",
                      "description": "The object response to the starting number, where 0 is the first available",
                      "format": "int64"
                    },
                    "limit": {
                      "type": "integer",
                      "description": "The number of items to be returned",
                      "format": "int32"
                    },
                    "results": {
                      "type": "object",
                      "properties": {
                        "feed": {
                          "type": "array",
                          "description": "The feed status results",
                          "items": {
                            "type": "object",
                            "properties": {
                              "feedId": {
                                "type": "string",
                                "description": "A unique ID used for tracking the Feed File"
                              },
                              "feedSource": {
                                "type": "string",
                                "description": "The source of the feed"
                              },
                              "feedType": {
                                "type": "string",
                                "description": "The feed type"
                              },
                              "partnerId": {
                                "type": "string",
                                "description": "The seller ID"
                              },
                              "itemsReceived": {
                                "type": "integer",
                                "description": "The number of items received",
                                "format": "int64"
                              },
                              "itemsSucceeded": {
                                "type": "integer",
                                "description": "The number of items in the feed that have successfully processed",
                                "format": "int64"
                              },
                              "itemsFailed": {
                                "type": "integer",
                                "description": "The number of items in the feed that failed due to a data or system error",
                                "format": "int64"
                              },
                              "itemsProcessing": {
                                "type": "integer",
                                "description": "The number of items in the feed that are still in progress",
                                "format": "int64"
                              },
                              "feedStatus": {
                                "type": "string",
                                "description": "Can be one of the following: RECEIVED, INPROGRESS, PROCESSED, or ERROR. For details, see the definitions listed under 'Feed Statuses' at the beginning of this section."
                              },
                              "feedDate": {
                                "type": "integer",
                                "description": "The date and time the feed was submitted. Format: yyyymmddThh:mm:ss.xxxz",
                                "format": "int64"
                              },
                              "batchId": {
                                "type": "string",
                                "description": "The batch ID for the feed, if provided"
                              },
                              "modifiedDtm": {
                                "type": "integer",
                                "description": "The most recent time the feed was modified. Format: yyyymmddThh:mm:ss.xxxz",
                                "format": "int64"
                              }
                            },
                            "description": "Information about the individual feed",
                            "xml": {
                              "name": "feed"
                            }
                          }
                        }
                      },
                      "description": "The feed status results"
                    }
                  },
                  "xml": {
                    "name": "list"
                  }
                },
                "example": "<?xml version=\"1.0\" encoding=\"UTF-8\" standalone=\"yes\"?>\n<ns2:list xmlns:ns2=\"http://walmart.com/\">\n    <ns2:totalResults>210</ns2:totalResults>\n    <ns2:offset>0</ns2:offset>\n    <ns2:limit>50</ns2:limit>\n    <ns2:results>\n        <ns2:feed>\n            <ns2:feedId>1401AE7FA2B045A79294C90C43671720@AVUBAQA</ns2:feedId>\n            <ns2:feedType>PROMO_PRICE</ns2:feedType>\n            <ns2:partnerId>100009</ns2:partnerId>\n            <ns2:itemsReceived>1</ns2:itemsReceived>\n            <ns2:itemsSucceeded>0</ns2:itemsSucceeded>\n            <ns2:itemsFailed>1</ns2:itemsFailed>\n            <ns2:itemsProcessing>0</ns2:itemsProcessing>\n            <ns2:feedStatus>PROCESSED</ns2:feedStatus>\n            <ns2:feedDate>2019-09-13T22:43:38.467Z</ns2:feedDate>\n            <ns2:modifiedDtm>2019-09-13T23:43:38.526Z</ns2:modifiedDtm>\n            <ns2:fileName>1401AE7FA2B045A79294C90C43671720@AVUBAQA.json</ns2:fileName>\n            <ns2:itemDataErrorCount>1</ns2:itemDataErrorCount>\n            <ns2:itemSystemErrorCount>0</ns2:itemSystemErrorCount>\n            <ns2:itemTimeoutErrorCount>0</ns2:itemTimeoutErrorCount>\n            <ns2:orgId>f5e3d40a-1267-46b9-a2f3-7811e4c0b2de</ns2:orgId>\n        </ns2:feed>\n        <ns2:feed>\n            <ns2:feedId>61CDBC483DB64EC097E7D0961DA54621@AU8BAgA</ns2:feedId>\n            <ns2:feedType>item</ns2:feedType>\n            <ns2:partnerId>100009</ns2:partnerId>\n            <ns2:itemsReceived>1</ns2:itemsReceived>\n            <ns2:itemsSucceeded>0</ns2:itemsSucceeded>\n            <ns2:itemsFailed>1</ns2:itemsFailed>\n            <ns2:itemsProcessing>0</ns2:itemsProcessing>\n            <ns2:feedStatus>INPROGRESS</ns2:feedStatus>\n            <ns2:feedDate>2019-09-13T20:46:33.195Z</ns2:feedDate>\n            <ns2:modifiedDtm>2019-09-13T20:46:33.383Z</ns2:modifiedDtm>\n            <ns2:fileName>61CDBC483DB64EC097E7D0961DA54621@AU8BAgA.json</ns2:fileName>\n            <ns2:itemDataErrorCou